    </div>\r\n            <div class="oa-content-section oa-content-text oa-text-regular">\r\n                <p>Jest to płatna, rozbudowana i wygodniejsza w użytkowaniu wersja naszego modułu Ceneo.pl. Moduł ten pozwala zmapować atrybuty Twoich produkt&oacute;w ze wszystkimi atrybutami z Ceneo.pl z r&oacute;żnych branż oraz przypisać Twoje produkty do konkretnych kategorii z Ceneo.pl, używając mocno konfigurowalnych masowych akcji lub po prostu edytując produkty jeden po drugim.</p>\r\n<p>Mapowania mogą być uruchamiane manualnie, ale codziennie uruchamia je r&oacute;wnież Cron Magento. Moduł tworzy adresy URL do dynamicznie generowanych plik&oacute;w XML (jeden dla każdego store view), kt&oacute;re możesz dodać do swoich kont w Ceneo.pl. Działają r&oacute;wnież dla Skapiec.pl, Radar.pl, Okazje.info.pl, Kupujemy.pl, Smartbay.pl oraz Cenuj.pl.</p>\r\n<p>Funkcjonalności, kt&oacute;rymi moduł płatny r&oacute;żni się od darmowego to:</p>\r\n<ul>\r\n<li>Możliwość zmapowania wszystkich atrybut&oacute;w Ceneo.pl (z wszystkich grup produktowych) z atrybutami Magento,&nbsp;</li>\r\n<li>Zaawansowany interfejs do przypisywania produktom kategorii z Ceneo.pl,&nbsp;</li>\r\n<li>Automatyzacja przypisywania produktom kategorii z Ceneo.pl (CRON),&nbsp;</li>\r\n<li>Możliwość importu aktualnych kategorii Ceneo.pl w dowolnym momencie.</li>\r\n</ul>\r\n            </div>\r\n                <div class="oa-contant-subtitle oa-content-section">\r\n        <h4 class="oa-text-accent">Cechy produktu</h4>\r\n    </div>\r\n    <div class="oa-contant-attributes oa-content-section">\r\n        <table class="product-attributes">\r\n            <tbody>\r\n                                    <tr>\r\n                        <td class="label">Gwarancja</td>\r\n                        <td class="data">24</td>\r\n                    </tr>\r\n                            </tbody>\r\n        </table>\r\n    </div>\r\n\r\n                <div class="oa-contant-subtitle oa-content-section">\r\n        <h4 cl