INSERT INTO `orba_allegro_template_text` (`value_id`, `entity_type_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(1, 153, 1986, 0, 1, '<style type="text/css">\r\n    .oa-left{\r\n        float: left;\r\n    }\r\n    .oa-right{\r\n        float: right;\r\n    }\r\n    .oa-clear{\r\n        clear: both;\r\n        height:0;\r\n    }\r\n    .oa-text-accent{\r\n        color: {{config path=''orbaallegro/template_design/accent_color''}};\r\n    }\r\n    .oa-underline{\r\n        text-decoration: underline;\r\n    }\r\n    .oa-text-regular{\r\n        color: {{config path=''orbaallegro/template_design/text_color''}};\r\n    }\r\n    .oa-text-light{\r\n        color: {{config path=''orbaallegro/template_design/text_light_color''}};\r\n    }\r\n    .oa-text-hero{\r\n        font-size: 36px;\r\n        letter-spacing: -1px;\r\n        font-weight: normal;\r\n    }\r\n    .oa-text-hero strong{\r\n        font-size: 48px;\r\n    }\r\n    .oa-container{\r\n        max-width: 1200px;\r\n        min-width: 980px;\r\n        margin: 0 auto;\r\n        font-family: Helvetica, Arial, sans-serif;\r\n        color: {{config path=''orbaallegro/template_design/text_color''}};\r\n    }\r\n    .oa-container h1,\r\n    .oa-container h2,\r\n    .oa-container h3,\r\n    .oa-container h4{\r\n        font-family: Helvetica, Arial, sans-serif;\r\n    }\r\n    .oa-contant-heading h1,\r\n    .oa-contant-heading h2,\r\n    .oa-leftcol h4,\r\n    .oa-contant-subtitle h4,\r\n    .oa-header h3,\r\n    .oa-header h4{\r\n        margin:0;\r\n        padding:0;\r\n    }\r\n    .oa-container a{\r\n        text-decoration: none;\r\n    }\r\n    .oa-container a:hover{\r\n        text-decoration: underline;\r\n    }\r\n\r\n    .oa-header{\r\n        margin-bottom: 45px;\r\n    }\r\n    .oa-header hr{\r\n        margin:0;\r\n        padding:0;\r\n        border:0;\r\n        border-bottom: 10px {{config path=''orbaallegro/template_design/accent_color''}} solid;\r\n    }\r\n    .oa-logo{\r\n        width: 250px;\r\n        height: 132px;\r\n        text-align: center;\r\n        margin: 45px 35px;\r\n    }\r\n    .oa-logo a,\r\n    .oa-logo img{\r\n        display: block;\r\n    }\r\n    .oa-logo img{\r\n        max-width: 250px;\r\n        margin: 0 auto;\r\n    }\r\n\r\n    .oa-header-info{\r\n        margin: 35px 35px 45px 0;\r\n    }\r\n    ul.oa-header-menu{\r\n        margin-bottom: 35px;\r\n        font-size: 11px;\r\n        list-style: none;\r\n        padding:0;\r\n        text-transform: uppercase;\r\n    }\r\n    .oa-header-menu li{\r\n        display: inline-block;\r\n        margin-left: 25px;\r\n    }\r\n    .oa-header-menu li:first-child{\r\n        margin-left: 0;\r\n    }\r\n    .oa-contact-holder h4{\r\n        display: inline-block;\r\n        font-weight: normal;\r\n        font-size: 24px;\r\n        margin-left: 20px;\r\n    }\r\n\r\n    .oa-icon-form,\r\n    .oa-icon-email,\r\n    .oa-icon-video,\r\n    .oa-contant-photo-video-shadow{\r\n        display: inline-block;\r\n        background: url("{{skin url=''orbaallegro/images/sprite.png''}}") no-repeat;\r\n    }\r\n\r\n    .oa-icon-form,\r\n    .oa-icon-email{\r\n        width: 25px;\r\n        height: 17px;\r\n        margin-right: 6px;\r\n    }\r\n\r\n    .oa-icon-email{\r\n        background-position: 0 0;\r\n    }\r\n    .oa-icon-form{\r\n        background-position: -25px 0;\r\n    }\r\n    .oa-leftcol{\r\n        border-right: 1px #eee solid;\r\n    }\r\n    .oa-leftcol-box{\r\n        width: 250px;\r\n        word-break: break-all;\r\n        padding: 0 35px;\r\n        background: url("{{skin url=''orbaallegro/images/sprite.png''}}") no-repeat 0 -100px;\r\n    }\r\n\r\n    .oa-leftcol-box > dl,\r\n    .oa-leftcol-box > div{\r\n        font-size: 12px;\r\n        color: {{config path=''orbaallegro/template_design/text_light_color''}};\r\n    }\r\n\r\n    .oa-leftcol-box > dl,\r\n    .oa-leftcol-box > dl > dd,\r\n    .oa-leftcol-box > dt > dl{\r\n        margin:0;\r\n        padding:0;\r\n    }\r\n\r\n    .oa-leftcol-box > dl{\r\n        line-height: 24px;\r\n    }\r\n\r\n    .oa-leftcol-box > dl > dd{\r\n        margin-bottom: 20px;\r\n    }\r\n\r\n    .oa-leftcol-box h4{\r\n        font-size: 30px;\r\n        font-weight: bold;\r\n        padding: 25px 0 20px 0;\r\n        letter-spacing: -1px;\r\n        color: {{config path=''orbaallegro/template_design/text_color''}};\r\n    }\r\n    .oa-list-big{\r\n        font-size: 18px;\r\n        color: {{config path=''orbaallegro/template_design/text_color''}};\r\n    }\r\n\r\n\r\n    .oa-content{\r\n        margin-left: 320px;\r\n        padding: 0 35px;\r\n        border-left: 1px #eee solid;\r\n    } \r\n    .oa-content-section{\r\n        margin-bottom: 60px;\r\n    }\r\n    .oa-contant-heading{\r\n        text-align: center;\r\n        padding: 10px 0;\r\n        margin-bottom: 35px;\r\n    }\r\n\r\n    .oa-content h1{\r\n        font-size: 58px;\r\n        letter-spacing: -4px;\r\n        margin-bottom: 10px;\r\n        font-weight: bold;\r\n        color: {{config path=''orbaallegro/template_design/text_color''}};\r\n    }\r\n    .oa-content h2{\r\n        font-size: 30px;\r\n        font-weight: normal;\r\n        letter-spacing: -2px;\r\n        color: {{config path=''orbaallegro/template_design/text_light_color''}};\r\n    }\r\n    .oa-contant-photo-wrapper{\r\n        border: 1px #eee solid;\r\n        background: #fff;\r\n        margin: 0 auto;\r\n        width: 610px;\r\n        position: relative;\r\n    }\r\n\r\n    .oa-contant-photo-wrapper > a,            \r\n    .oa-contant-photo-wrapper > a > img{\r\n        display: block;\r\n    }\r\n\r\n    .oa-contant-photo-wrapper > a{\r\n        width: 590px;\r\n        padding: 10px;\r\n    }\r\n    .oa-contant-photo-wrapper > a > img{\r\n        width: 590px;\r\n    }\r\n    .oa-contant-photo-video{\r\n        position: absolute;\r\n        bottom: 50px;\r\n        right: -24px;\r\n        height: 72px;\r\n        background: #f6f6f6;\r\n        line-height: 36px;\r\n\r\n    }\r\n    .oa-contant-photo-video a{\r\n        display: inline-block;\r\n        padding: 18px 48px;\r\n        font-size: 24px;\r\n        letter-spacing: -2px;\r\n        color: {{config path=''orbaallegro/template_design/text_color''}};\r\n        text-transform: uppercase;\r\n    }\r\n    .oa-icon-video{\r\n        width: 47px;\r\n        height: 33px;\r\n        vertical-align: middle;\r\n        background-position: 0 -17px;\r\n        margin-left: 20px;\r\n        margin-top: -5px;\r\n\r\n    }\r\n    .oa-contant-photo-video-shadow{\r\n        width: 24px;\r\n        height: 24px;\r\n        position: absolute;\r\n        right:0;\r\n        bottom: -24px;\r\n        background-position: -50px -17px;\r\n    }\r\n    .oa-contant-subtitle{\r\n        margin-bottom: 35px;\r\n        border-bottom: 1px #eee solid;\r\n        height: 20px;\r\n        position: relative;\r\n    }\r\n    .oa-contant-subtitle h4{\r\n        font-size: 24px;\r\n        display: inline-block;\r\n        position: absolute;\r\n        font-weight: bold;\r\n        background: #fff;\r\n        padding-right: 15px;\r\n        margin-bottom: -12px;\r\n        letter-spacing: -1px;\r\n    }\r\n    .oa-content-text{\r\n        font-size: 14px;\r\n        line-height: 24px;\r\n    }\r\n    .oa-contant-attributes table{\r\n        width: 100%;\r\n        line-height: 18px;\r\n        font-size: 14px;\r\n    }\r\n    .oa-contant-attributes table td{\r\n        vertical-align: top;\r\n        padding: 5px 0;\r\n        color: {{config path=''orbaallegro/template_design/text_color''}};\r\n    }\r\n\r\n    .oa-contant-attributes table .label{\r\n        font-weight: bold;\r\n        width: 30%;\r\n    }\r\n    .oa-contant-attributes table .data{\r\n        width: 70%;\r\n    }\r\n    .oa-contant-gallery a{\r\n        display: inline-block;\r\n        padding: 10px;\r\n        border: 1px #eee solid;\r\n    }\r\n    .oa-contant-gallery ul,\r\n    .oa-contant-gallery li{\r\n        margin:0;\r\n        padding:0;\r\n    }\r\n    .oa-contant-gallery li{\r\n        margin-bottom: 20px;\r\n    }\r\n    .oa-contant-gallery img{\r\n        max-width: 590px;\r\n        display: block;\r\n    }\r\n</style>\r\n<div class="oa-container">\r\n    <div class="oa-header">\r\n        <div class="oa-wrapper">\r\n            <div class="oa-logo oa-left">\r\n                <a href="{{store direct_url=''''}}" target="_blank"><img src="{{var logo_url}}" alt="Logo"/></a>\r\n            </div>\r\n            <div class="oa-header-info oa-right">\r\n                {{block type="orbaallegro/cms_block" block_id="orbaallegro_topmenu"}}\r\n                <h3 class="oa-right oa-text-hero">\r\n                    <em class="oa-text-regular">tel.</em> <strong class="oa-text-accent">{{var user.userPhone}}</strong>\r\n                </h3>\r\n                <div class="oa-clear"></div>\r\n\r\n                <div class="oa-contact-holder oa-right">\r\n                    <h4><a href="mailto:{{var user.userEmail}}" class="oa-text-accent"><i class="oa-icon-email"></i>{{var user.userEmail}}</a></h4>\r\n                    <h4><a href="{{var contact_link}}" class="oa-text-accent"><i class="oa-icon-form"></i>formularz online</a></h4>\r\n                </div>\r\n                <div class="oa-clear"></div>\r\n            </div>\r\n            <div class="oa-clear"></div>\r\n        </div>\r\n        <hr/>\r\n    </div>\r\n    <div class="oa-main">\r\n        <div class="oa-left oa-leftcol">\r\n            {{block type="orbaallegro/cms_block" block_id="orbaallegro_about"}}\r\n        </div>\r\n        <div class="oa-content">\r\n            <div class="oa-contant-heading">\r\n                <h1><strong></strong>{{var product.name}}</strong></h1>\r\n                <h2>Kup Teraz za <strong class="oa-text-accent oa-underline">{{var product.getFormatedPrice()}}</strong></h2>\r\n            </div>\r\n            <div class="oa-contant-photo oa-content-section">\r\n                <div class="oa-contant-photo-wrapper">\r\n                    <a href="{{var product.getProductUrl()}}"  target="_blank"><img src="{{var product_photo_url}}" alt=""/></a>\r\n                    {{if youtube_url}}\r\n                    <div class="oa-contant-photo-video">\r\n                        <a href="{{var youtube_url}}">Film<i class="oa-icon-video"></i></a>\r\n                        <div class="oa-contant-photo-video-shadow"></div>\r\n                    </div>\r\n                    {{/if}}\r\n                </div>\r\n            </div>\r\n            <div class="oa-contant-subtitle oa-content-section">\r\n                <h4 class="oa-text-accent">Szczegóły produktu</h4>\r\n            </div>\r\n            <div class="oa-content-section oa-content-text oa-text-regular">\r\n                {{var product.description}}\r\n            </div>\r\n            {{var attributes}}\r\n            {{var gallery}}\r\n            {{block type="orbaallegro/cms_block" block_id="orbaallegro_other"}}\r\n        </div>\r\n    </div>\r\n</div>');
